import React from "react";
import axios from 'axios';
import { Button, FormGroup, Form } from "react-bootstrap";
// import "./Login.css"

class Login extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            user: "",
            password: "",
            greeting: "",
        }
        this.handleClick = this.handleClick.bind(this);
    }

    handleClick() {
        
        axios.post(("http://localhost:8080/api/v1/auth/authenticate"), {
            "email": this.state.user,
            "password": this.state.password
        }).then(response => this.setState({greeting: response.message}))
        .catch(response => this.setState({greeting: response.message}));
      }

  render () {
    return (
      <div className="p-20">
        <Form className="mx-auto" >
          <FormGroup>
            <Form.Label htmlFor="emailInput">Email: </Form.Label>
            <Form.Control type="email" id="emailInput" placeholder="Ivanov@mail.rur" onChange={(event) => this.setState({user: event.target.value})}></Form.Control>
          </FormGroup>
          <FormGroup >
            <Form.Label htmlFor="passwordInput">Password: </Form.Label>
            <Form.Control type="password" id="passwordInput" placeholder="От 8 цифр" onChange={(event) => this.setState({password: event.target.value})}></Form.Control>
          </FormGroup>
          <Button className="m-3 login-container" variant ="outline-primary" onClick={this.handleClick}>Жмит!</Button>
        </Form>
        
        <div>{this.state.greeting}</div>
      </div>
    )
  }  
}

export default Login;
